import React from 'react';

const About = () => {
  return (
    <section className='mb-72'>
      <h1 className='text-6xl font-bold mt-14'>ABOUT US</h1>
      <p className='text-center px-20 text-xl font-normal mt-20 mb-16'>
        LuxyPalace specializes in high-end Jewelries, golds, diamonds, rubies, sapphire, pearls, necklaces, pendants, wedding rings, and bridal accessories that are not
        commonly found. We purchase small quantities of each item from an array of exclusive European designers. Many of our designers, only produce a limited quantity
        of each collection. Therefore, once a particular item is sold out, we are generally not able to reorder additional merchandise, depending upon the designer.
      </p>
      <cite>LuxyPalace</cite>
    </section>
  );
};

export default About;
